import axios from "axios";

const BACKEND_URL = "http://127.0.0.1:8000";

export const axiosInstance = axios.create({baseURL: BACKEND_URL})

export const fetchAllProducts = () => {
    axiosInstance
        .get('/product')
        .then(response => response?.data)
}
